   "source": [
    "k <- 2  # Adjust based on the elbow curve\n",
    "set.seed(123)\n",
    "\n",
    "km_result <- kmeans(scaled_data, centers = k, nstart = 25)\n",
    "\n",
    "# Add cluster assignments to the user_averages dataframe\n",
    "user_averages_with_clusters <- user_averages_for_clustering %>%\n",
    "  mutate(Cluster = ifelse(Id %in% user_averages_for_clustering$Id, \n",
    "                          km_result$cluster[match(Id, user_averages_for_clustering$Id)], \n",
    "                          NA))\n",
    "\n",
    "# Visualize the clusters\n",
    "fviz_cluster(list(data = scaled_data, cluster = km_result$cluster),\n",
    "             geom = \"point\",\n",
    "             ellipse.type = \"convex\",\n",
    "             palette = \"jco\",\n",
    "             ggtheme = theme_minimal())"
   ]
