   "source": [
    "# Function to generate tailored recommendations based on actual summary metrics  \n",
    "generate_recommendations_new <- function(summary_row) {  \n",
    "  cluster_active <- summary_row$AvgActiveMinutes  \n",
    "  cluster_sleep <- summary_row$AvgSleepEfficiency  \n",
    "  \n",
    "  # Tailored rules based on cluster averages  \n",
    "  if(cluster_active >= 200 & cluster_sleep >= 0.93) {  \n",
    "    # For highly active users with excellent sleep (e.g., Cluster 1)  \n",
    "    return(\"This segment is highly active with excellent sleep quality. Focus on recovery strategies, optimized nutrition, and fine-tuning your sleep routines to maintain performance and prevent burnout.\")  \n",
    "  } else if(cluster_active < 150 & cluster_sleep < 0.90) {  \n",
    "    # For less active users with lower sleep efficiency (e.g., Cluster 2)  \n",
    "    return(\"This segment is relatively less active with moderate sleep quality. Consider gradually increasing daily physical activity and adopting sleep hygiene improvements to boost both energy and rest.\")  \n",
    "  } else if(cluster_active < 150 & cluster_sleep >= 0.90) {  \n",
    "    # Relatively less active but with decent sleep efficiency  \n",
    "    return(\"This segment shows modest activity levels with good sleep quality. Enhance your daily activity through gradual increases and complementary intermittent exercise routines.\")  \n",
    "  } else if(cluster_active >= 150 & cluster_active < 200) {  \n",
    "    # Moderately active users regardless of sleep efficiency can benefit from balanced improvements  \n",
    "    return(\"This segment has moderate daily activity. Focus on maintaining a balanced approach between activity, adequate rest, and nutrition to steadily improve your overall health.\")  \n",
    "  } else {  \n",
    "    # Fallback recommendation  \n",
    "    return(\"General recommendation: Monitor your daily routines and consider small, incremental adjustments to both physical activity and sleep habits for overall wellness improvement.\")  \n",
    "  }  \n",
    "}"
   ]
  },
