    "# Loop through each cluster and print tailored recommendations  \n",
    "clusters <- unique(na.omit(user_averages_with_clusters$Cluster))  \n",
    "for(clust in clusters) {  \n",
    "  summary_row <- cluster_summary %>% filter(Cluster == clust)  \n",
    "  recommendation <- generate_recommendations_new(summary_row)  \n",
    "  cat(\"Cluster\", clust, \":\\n\")  \n",
    "  cat(\" - Count:\", summary_row$Count, \"\\n\")  \n",
    "  cat(\" - Average Active Minutes:\", round(summary_row$AvgActiveMinutes, 2), \"\\n\")  \n",
    "  cat(\" - Average Sleep Efficiency:\", round(summary_row$AvgSleepEfficiency, 3), \"\\n\")  \n",
    "  cat(\" - Recommendation:\", recommendation, \"\\n\\n\")  \n",
    "}"
   ]
