   "source": [
    "options(repr.plot.width = 20, repr.plot.height = 30) # Adjust width and height as needed\n",
    "\n",
    "# Define predictor variables Here, a vector of predictor variable names is defined. \n",
    "\n",
    "predictors <- c(\"AvgVeryActiveMinutes\", \"AvgFairlyActiveMinutes\", \"AvgLightlyActiveMinutes\",\n",
    "                \"AvgSedentaryMinutes\", \"AvgTotalSteps\")\n",
    "\n",
    "# Build a decision tree model for each cluster\n",
    "# The code iterates over each unique cluster in user_averages_with_clusters\n",
    "# (ignoring any clusters that are NA) to build separate models for each subgroup.\n",
    "for(clust in unique(na.omit(user_averages_with_clusters$Cluster))) {\n",
    "  cat(\"Building predictive model for Cluster\", clust, \"\n",
    "\")\n",
    "  \n",
    "  cluster_data <- user_averages_with_clusters %>% filter(Cluster == clust)\n",
    "  \n",
    "  if(nrow(cluster_data) < 5) {\n",
    "    cat(\" - Not enough data to build a reliable model for this cluster.\n",
    "\n",
    "\")\n",
    "    next\n",
    "  }\n",
    "  \n",
    "  complete_cases <- complete.cases(cluster_data[, predictors])\n",
    "  if(sum(complete_cases) < 5) {\n",
    "    cat(\" - Not enough complete cases for predictors to build a reliable model.\n",
    "\n",
    "\")\n",
    "    next\n",
    "  }\n",
    "  \n",
    "  model_data <- cluster_data[complete_cases, ]\n",
    "  formula <- as.formula(paste(\"as.factor(ActivityGoalMet) ~\", paste(predictors, collapse = \" + \")))\n",
    "  \n",
    "  tryCatch({\n",
    "    tree_model <- rpart(formula, data = model_data, method = \"class\", \n",
    "                        control = rpart.control(minsplit = 2, minbucket = 1))\n",
    "    \n",
    "    print(summary(tree_model))\n",
    "    \n",
    "    if(nrow(tree_model$frame) > 1) {\n",
    "      rpart.plot(tree_model, main = paste(\"Decision Tree for Cluster\", clust))\n",
    "    } else {\n",
    "      cat(\" - Model did not find any significant splits in the data.\n",
    "\")\n",
    "    }\n",
    "  }, error = function(e) {\n",
    "    cat(\" - Error building model:\", e$message, \"\n",
    "\")\n",
    "  })\n",
    "  \n",
    "  cat(\"\n",
    "\")\n",
    "}\n",
    "\n",
    "# Workflow Inside the Loop:\n",
    "# Data Filtering: The code selects only those rows corresponding to the current cluster.\n",
    "# Minimum Data Check: It ensures the cluster has at least 5 rows; if not, it skips to the next cluster.\n",
    "# Complete Cases Check: It makes sure there are at least 5 rows with complete predictor data.\n",
    "# Model Preparation: Only complete cases are used to build the model. \n",
    "# A formula is constructed where ActivityGoalMet (converted to a factor) is predicted using the selected predictors.\n",
    "# Decision Tree Modeling:\n",
    "# The rpart package is used to build a decision tree. \n",
    "# The control parameters (minsplit = 2, minbucket = 1) allow the tree to split even on small samples.\n",
    "# Model Evaluation and Plotting:\n",
    "# A summary of the model is printed.\n",
    "# If the tree contains more than one terminal node (i.e., it found significant splits) then it is visualized with rpart.plot.\n",
    "# If no splits were found or an error occurs, appropriate messages are displayed.\n",
    "# Error Handling:\n",
    "# The tryCatch block captures any errors during model building (for example, due to data issues) \n",
    "# and outputs an error message, ensuring the loop continues to process subsequent clusters.\n",
    "# In summary, this code computes a binary outcome for whether users meet an activity goal, specifies which predictors to use, \n",
    "# and then, for each cluster of users (assuming there’s enough data), builds and visualizes a decision tree model to understand what factors predict whether users meet their activity goal. This is used to drive personalized recommendations tailored to each sub-group's characteristics."
