   "source": [
    "# Assuming user_averages_with_clusters is your dataset with all users  \n",
    "# Define sleep efficiency threshold  \n",
    "sleep_efficiency_threshold <- 0.94  \n",
    "  \n",
    "# Create the binary outcome variable for all users  \n",
    "user_averages_all <- user_averages_with_clusters %>%  \n",
    "  mutate(  \n",
    "    ActivityGoalMet = ifelse(!is.na(AvgSleepEfficiency) &   \n",
    "                             AvgSleepEfficiency >= sleep_efficiency_threshold, 1, 0)  \n",
    "  )  \n",
    "  \n",
    "# Define predictors  \n",
    "predictors <- c(\"AvgVeryActiveMinutes\", \"AvgFairlyActiveMinutes\", \"AvgLightlyActiveMinutes\",  \n",
    "                \"AvgSedentaryMinutes\", \"AvgTotalSteps\")  \n",
    "  \n",
    "# Create the formula for the decision tree  \n",
    "formula <- as.formula(paste(\"ActivityGoalMet ~\", paste(predictors, collapse = \" + \")))  \n",
    "  \n",
    "# Print information about the analysis  \n",
    "cat(\"Building predictive model for ALL users\\n\")  \n",
    "cat(\"Dependent variable: Sleep efficiency >=\", sleep_efficiency_threshold, \"\\n\")  \n",
    "cat(\"Number of observations:\", nrow(user_averages_all), \"\\n\")  \n",
    "cat(\"Class distribution:\", table(user_averages_all$ActivityGoalMet), \"\\n\\n\")  \n",
    "  \n",
    "# Build the decision tree model for all users  \n",
    "# You can adjust the control parameters as needed  \n",
    "tree_model <- rpart(  \n",
    "  formula = formula,  \n",
    "  data = user_averages_all,  \n",
    "  method = \"class\",  \n",
    "  control = rpart.control(minsplit = 2, minbucket = 1)  \n",
    ")  \n",
    "  \n",
    "# Print the tree model  \n",
    "print(tree_model)  \n",
    "  \n",
    "# Plot the tree for visualization  \n",
    "rpart.plot(tree_model, extra = 106)  \n",
    "  \n",
    "# Calculate variable importance  \n",
    "var_importance <- tree_model$variable.importance  \n",
    "if(!is.null(var_importance)) {  \n",
    "  # Convert to percentage  \n",
    "  var_importance_pct <- round(100 * var_importance / sum(var_importance))  \n",
    "    \n",
    "  # Print variable importance  \n",
    "  cat(\"\\nVariable importance (%):\\n\")  \n",
    "  for(var in names(var_importance_pct)) {  \n",
    "    cat(sprintf(\"%s: %d%%\\n\", var, var_importance_pct[var]))  \n",
    "  }  \n",
    "}  \n",
    "  \n",
    "# Optional: Evaluate model performance  \n",
    "# add code for cross-validation   "
   ]
  }
